import React from "react";
function Header({ isDarkMode, onDarkModeClick }) {
  return (
    <header>
      <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fimages.unsplash.com%2Fphoto-1508921912186-1d1a45ebb3c1%3Fixlib%3Drb-4.0.3%26ixid%3DMnwxMjA3fDB8MHxzZWFyY2h8Mnx8cGhvdG98ZW58MHx8MHx8%26w%3D1000%26q%3D80&tbnid=lQOcu0jW5n2mEM&vet=12ahUKEwj8htiF_eb-AhXdmycCHRecDS0QMygAegUIARDjAQ..i&imgrefurl=https%3A%2F%2Funsplash.com%2Fs%2Fphotos%2Fphoto&docid=AgAT_yR1X6xrJM&w=1000&h=1500&q=photos&ved=2ahUKEwj8htiF_eb-AhXdmycCHRecDS0QMygAegUIARDjAQ" className="img"/>
      <button onClick={onDarkModeClick}>
        {isDarkMode ? "Dark" : "Light"} Mode
      </button>
    </header>
  );
}

export default Header;
